import React from 'react';
import Card from 'react-bootstrap/Card';
import '../App.css';

const PersonCard = props => {
    return (
        <Card className = "cardLayout">
            <Card.Body>
                <Card.Title>{props.name}</Card.Title>
            </Card.Body>
        </Card>
    );
}

export default PersonCard;
